import React from "react";
import logo from "../image/logo.png";
export default function Navbar() {
  return (
    <header>
      <nav className="navbar">
        <img src={logo} alt="logo" />
        <h2>MemesGenerator</h2>
        <table className="Table">
          <tbody>
            <tr>
              <th></th>
              <th></th>
            </tr>
             <td></td>
             <td></td>
          </tbody>
        </table>
      </nav>
    </header>
  );
}
